#include<iostream>
#include<vector>
#include<map>
using namespace std;
class Solution {
public:
    vector<int> findSubstring(string s, vector<string>& words) {
        vector<int> res;
        if(words.size()==0)
            return res;
        int word_length = words[0].size();
        if(words.size()*word_length>s.size())
            return res;
        map<string,int> word_count;
        for(int i=0;i<words.size();i++){
            map<string ,int >::iterator l_it = word_count.find(words[i]);
            if(l_it==word_count.end())
                word_count[words[i]] = 1;
            else{
                word_count[words[i]]++;
            }
        }
        map<string, int> count_map;
        int i = 0;
        int start = 0;
        while(i<s.size()){
            cout<<i<<endl;
            string a=s.substr(i,word_length);
            map<string ,int >::iterator l_it = word_count.find(a);
            if(l_it!=word_count.end()){
                map<string ,int >::iterator l_it2 = count_map.find(a);
                if(l_it2==count_map.end()){
                    count_map[a] = 1;
                    i+=word_length;
                }
                else{
                    count_map[a]++;
                    if(count_map[a]>word_count[a]){
                       i = start+1;
                       start = i;
                       count_map.clear();
                    }
                    else{
                        i+= word_length;
                    }
                }
            }
            else{
                count_map.clear();
                i=start+1;
                start = i;
            }
            if(word_count.size()==count_map.size()){
                map<string ,int >::iterator it;
                int right = 0;
                for (it = count_map.begin(); it != count_map.end( ); it++ ){
                    if(it->second==word_count[it->first]){
                        right++;
                    }
                    else
                        break;
                }
                if(right==word_count.size()){
                    res.push_back(start);
                    i=start+1;
                    start = i;
                    count_map.clear();
                }
            }
        }
    }
};
